  \"2015-01-07T18:35:37.823269\",\n\t\"name\": \"wetlands-deepwater-habitats-montana-wetland-and-riparian-framework-map-serviceca0f1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Montana Wetland and Riparian Framework
  represents the extent, type, and approximate location of wetlands, riparian areas,
  and deepwater habitats in Montana. These data delineate the areal extent of wetlands
  and deepwater habitats as defined by Cowardin et al. (1979) and riparian areas as
  defined by the U.S. Fish and Wildlife Service (2009). The Montana Wetland and Riparian
  Framework consists of features that were manually digitized at a scale of 1:4,500
  or 1:5,000 from orthorectified digital color-infrared aerial imagery collected during
  the summers of 2005, 2006, 2009, 2011, and 2013 by the National Agricultural Imagery
  Program (NAIP). These data are intended for use in publications at a scale of 1:12,000
  or smaller. This layer consists of two feature datasets: NHP_Layers and NHP_quadStatus.The
  NHP_Layers feature dataset contains the digital wetland and riparian mapping and
  consists of the feature class finalprovWetRip. This feature class consists of data
  that have undergone three rounds of internal quality assurance/quality control procedures
  by the MTNHP. For data where the Status field is Final, the data have been sent
  to and approved by the Regional Coordinator of the National Wetlands Inventory of
  the U.S. Fish and Wildlife Service. For data where the Status field is Provisional,
  the data have undergone three rounds of internal quality assurance/quality control
  procedures by the MTNHP but have not been sent to the Regional Coordinator of the
  National Wetlands Inventory of the U.S. Fish and Wildlife Service. The quadStatus
  feature dataset contains information about the mapping status of each topographic
  quad and consists of five feature classes: activeProjectList, finalStatus, historicNWI,
  noMapping, and provStatus. The activeProjectList feature class consists of quads
  that are currently being mapped by the MTNHP; the finalStatus feature class consists
  of quads with mapping that has been approved by the Regional Coordinator of the
  NWI; the historic NWI feature class consists of quads that were mapped by the U.S.
  Fish and Wildlife Service using 1980s-era imagery, this includes quads with both
  digital and non-digital mapping; the noMapping feature class consists of quads for
  which no mapping exists and no mapping is currently planned; and the provStatus
  feature class consists of quads with provisional wetland mapping.\",\n\t\"license_title\":
