  \"spatial-data-service-type\",\n\t\t\"value\": \"\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\":
  \"[\"Use Constraints: Federal, state, and local regulatory agencies with jurisdiction
  over wetlands may define and describe wetlands in a different manner than that used
  in this layer. There is no attempt, in either the design or products of this inventory,
  to define the limits of proprietary jurisdiction of any federal, state, or local
  government or to establish the geographical scope of the regulatory programs of
  government agencies. Persons intending to engage in activities involving modifications
  within or adjacent to wetland areas should seek the advice of appropriate federal,
  state, or local agencies concerning specified agency regulatory programs and proprietary
  jurisdictions that may affect such activities. Information in this data layer is
  not intended to be used as a precise locator of wetland boundaries, for site specific
  planning or management, or for regulatory purposes. Proper use of wetland and riparian
  mapping requires knowledge of the inherent limitations of this mapping. It is suggested
  that users also consult other information to aid in wetland detection, such as U.S.
  Department of Agriculture soil survey reports and other wetland maps that may have
  been produced by state and local governments.\", \"Access Constraints: None. Acknowledgement
